import React, { Component } from 'react'

class WeeklyPlanner extends Component {
    constructor(props) {
        super(props);
        this.state = {}
    }

    render() {
        return (
            <p>Weekly Planner Component</p>
        )
    }
}

export default WeeklyPlanner;
